description:
An LSD trip rather than anything intellectual. A group of students go to the Eden club where they play bizarre and cruel games including fake Russian Roulette, strange rituals, rape, blood-drinking and poison, until a mysterious stranger appears and ups the ante. After a bloody magic trick, he provides an African drug to a girl who sees a montage of fearful images and then slowly appears to live them, wandering into a strange fluid factory and into a postcard of Tunisia, where murders, S&amp;M sex, dancing and a nonsensical plot of kidnapping and torture in order to locate a painting take place. The film is an experience, a reality created by illusions, hallucinations and drugs, with bizarre visuals and details emerging little by little as some images develop into scenes, albeit incoherent ones. Not at all intellectually stimulating like his other movies. 

